var getTextureByName = function (name, scene) {
    // "this" is forbidden since this code is exported directly
    for (var i = 0; i < scene.textures.length; i++) {
        var texture = scene.textures[i];
        if (texture.name === name) {
            return texture;
        }
    }
    return null;
}

function CreateBabylonScene(scene) {
    var engine = scene.getEngine();
    var node = null;

    reflectionProbe = new BABYLON.ReflectionProbe("rp", 512, scene, true);
    reflectionProbe.renderList.push(scene.getNodeByName("skybox"));
    reflectionProbe.renderList.push(scene.getNodeByName("New Ground"));
    reflectionProbe.renderList.push(scene.getNodeByName("New Sphere"));

    // Configure node skybox
    node = scene.getNodeByName("skybox");
    node.position = new BABYLON.Vector3(0, 0, 0);
    node.rotation = new BABYLON.Vector3(0, 0, 0);
    node.scaling = new BABYLON.Vector3(1, 1, 1);

    node.material = new BABYLON.StandardMaterial("skybox", scene);
    node.material.checkReadyOnEveryCall = false;
    node.material.checkReadyOnlyOnce = false;
    node.material.alpha = 1;
    node.material.backFaceCulling = false;
    node.material.sideOrientation = 1;
    node.material.alphaMode = 2;
    node.material.disableDepthWrite = false;
    node.material.fogEnabled = true;
    node.material.pointSize = 1;
    node.material.zOffset = 0;
    node.material.ambientColor = new BABYLON.Color3(0, 0, 0);
    node.material.diffuseColor = new BABYLON.Color3(0, 0, 0);
    node.material.specularColor = new BABYLON.Color3(0, 0, 0);
    node.material.specularPower = 64;
    node.material.emissiveColor = new BABYLON.Color3(0, 0, 0);
    node.material.useAlphaFromDiffuseTexture = false;
    node.material.useEmissiveAsIllumination = false;
    node.material.linkEmissiveWithDiffuse = false;
    node.material.useReflectionFresnelFromSpecular = false;
    node.material.useSpecularOverAlpha = true;
    node.material.disableLighting = true;
    node.material.roughness = 0;
    node.material.useLightmapAsShadowmap = false;
    node.material.useGlossinessFromSpecularMapAlpha = false;
    node.material.reflectionTexture = getTextureByName("./Tests/textures/skybox/glacier", scene);
    node.material.wireframe = false;
    node.material.pointsCloud = false;
    node.material.fillMode = 0;

    // Configure node New Particle System

    node = new BABYLON.Mesh("New Particle System", scene, null, null, true);
    var particleSystem = new BABYLON.ParticleSystem("New Particle System", 1000, scene);
    particleSystem.emitter = node;
    particleSystem.name = "New Particle System";
    particleSystem.renderingGroupId = 0;
    particleSystem.emitRate = 1500;
    particleSystem.manualEmitCount = -1;
    particleSystem.updateSpeed = 0.005;
    particleSystem.targetStopDuration = 0;
    particleSystem.disposeOnStop = false;
    particleSystem.minEmitPower = 1;
    particleSystem.maxEmitPower = 3;
    particleSystem.minLifeTime = 0.3;
    particleSystem.maxLifeTime = 1.5;
    particleSystem.minSize = 0.1;
    particleSystem.maxSize = 0.5;
    particleSystem.minAngularSpeed = 0;
    particleSystem.maxAngularSpeed = 3.141592653589793;
    particleSystem.layerMask = 268435455;
    particleSystem.blendMode = 0;
    particleSystem.forceDepthWrite = false;
    particleSystem.gravity = new BABYLON.Vector3(0, -9.81, 0);
    particleSystem.direction1 = new BABYLON.Vector3(-7, 8, 3);
    particleSystem.direction2 = new BABYLON.Vector3(7, 8, -3);
    particleSystem.minEmitBox = new BABYLON.Vector3(-1, 0, 0);
    particleSystem.maxEmitBox = new BABYLON.Vector3(1, 0, 0);
    particleSystem.color1 = new BABYLON.Color4(0.7, 0.8, 1, 1);
    particleSystem.color2 = new BABYLON.Color4(0.2, 0.5, 1, 1);
    particleSystem.colorDead = new BABYLON.Color4(0, 0, 0.2, 0);
    particleSystem.textureMask = new BABYLON.Color4(1, 1, 1, 1);
    particleSystem.id = "New Particle System";
    particleSystem.particleTexture = BABYLON.Texture.CreateFromBase64String("data:image/png;base64,", "data:data:Jesse.png", scene);
    particleSystem.start();
    node.position = new BABYLON.Vector3(0, 0, 0);
    node.rotation = new BABYLON.Vector3(0, 0, 0);
    node.scaling = new BABYLON.Vector3(1, 1, 1);


}
